/**
 * @param {string} s
 * @param {string} t
 * @return {number}
 */
var appendCharacters = function(s, t) {
    let passCount = 0
    let lastPos = 0
    for(let c of t){
        let tmp = s.indexOf(c, lastPos)
        if(tmp < 0 ){
            break;
        }
        lastPos = tmp + 1 
        passCount++
    }
    return t.length - passCount
    
};

// s = "abcde", t = "a"
// s = "z", t = "abcde"
// s = "coaching", t = "coding"
s = "";
t =""
console.log(appendCharacters(s,t))